trailingComments.value:
*
 *  用于判断客户端能否正常打开这个url地址，包含http://https://scmehe://
 *  @param jsonString
 *  @return 0：传入参数解析失败 1：传入参数解析成功
 *
 * document.addEventListener('lib-sq-ready', (evt) => {
    const { lib } = evt.detail;
    lib.exec('isCallAppUrl', { params: {
      url: 'youku://',
    } }).then((info) => {
      console.log(`[isCallAppUrl][then] ${JSON.stringify(info, null, 2)}`);
    }).catch((err) => {
      alert(`[isCallAppUrl][error] ${JSON.stringify(err, null, 2)}`);
      const e = err.detail.__$rawError__;
      alert(e.message);
      alert(e.stack);
    });
  }, false);

